pragma solidity ^0.4.19;


/**
 * Math operations with safety checks
 */
contract SafeMath {
  function mul(uint a, uint b) internal returns (uint) {
    uint c = a * b;
    assert(a == 0 || c / a == b);
    return c;
  }

  function div(uint a, uint b) internal returns (uint) {
    assert(b > 0);
    uint c = a / b;
    assert(a == b * c + a % b);
    return c;
  }

  function sub(uint a, uint b) internal returns (uint) {
    assert(b <= a);
    return a - b;
  }

  function add(uint a, uint b) internal returns (uint) {
    uint c = a + b;
    assert(c >= a);
    return c;
  }

  function assert(bool assertion) internal {
    if (!assertion) {
      throw;
    }
  }
}


/// Implements ERC 20 Token standard: https://github.com/ethereum/EIPs/issues/20
/// @title Abstract token contract - Functions to be implemented by token contracts.

contract AbstractToken {
    // This is not an abstract function, because solc won't recognize generated getter functions for public variables as functions
    function totalSupply() constant returns (uint256 supply) {}
    function balanceOf(address owner) constant returns (uint256 balance);
    function transfer(address to, uint256 value) returns (bool success);
    function transferFrom(address from, address to, uint256 value) returns (bool success);
    function approve(address spender, uint256 value) returns (bool success);
    function allowance(address owner, address spender) constant returns (uint256 remaining);

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
    event Issuance(address indexed to, uint256 value);
}


contract StandardToken is AbstractToken {
    uint transferLockedUntil;


    /*
     *  Data structures
     */
    mapping (address => uint256) balances;
    mapping (address => mapping (address => uint256)) allowed;
    uint256 public totalSupply;

    modifier canTransfer {
        require(transferLockedUntil < now);
        _;
    }

    /*
     *  Read and write storage functions
     */
    /// @dev Transfers sender's tokens to a given address. Returns success.
    /// @param _to Address of token receiver.
    /// @param _value Number of tokens to transfer.

    //Note the internal
    function transfer(address _to, uint256 _value) canTransfer returns (bool success) {
        if (balances[msg.sender] >= _value && balances[_to] + _value > balances[_to]) {
            balances[msg.sender] -= _value;
            balances[_to] += _value;
            Transfer(msg.sender, _to, _value);
            return true;
        }
        else {
            return false;
        }
    }

    /// @dev Allows allowed third party to transfer tokens from one address to another. Returns success.
    /// @param _from Address from where tokens are withdrawn.
    /// @param _to Address to where tokens are sent.
    /// @param _value Number of tokens to transfer.
    function transferFrom(address _from, address _to, uint256 _value) canTransfer returns (bool success) {
      if (balances[_from] >= _value && allowed[_from][msg.sender] >= _value && balances[_to] + _value > balances[_to]) {
            balances[_to] += _value;
            balances[_from] -= _value;
            allowed[_from][msg.sender] -= _value;
            Transfer(_from, _to, _value);
            return true;
        }
        else {
            return false;
        }
    }

    /// @dev Returns number of tokens owned by given address.
    /// @param _owner Address of token owner.
    function balanceOf(address _owner) constant returns (uint256 balance) {
        return balances[_owner];
    }

    /// @dev Sets approved amount of tokens for spender. Returns success.
    /// @param _spender Address of allowed account.
    /// @param _value Number of approved tokens.
    function approve(address _spender, uint256 _value) canTransfer returns (bool success) {
        return transferFrom(_spender, msg.sender, _value);
    }

    function approveFrom(address _spender, address _sender, uint256 _value) internal returns (bool success) {
        allowed[_sender][_spender] = _value;
        Approval(_sender, _spender, _value);
        return true;
    }

    /*
     * Read storage functions
     */
    /// @dev Returns number of allowed tokens for given address.
    /// @param _owner Address of token owner.
    /// @param _spender Address of token spender.
    function allowance(address _owner, address _spender) constant returns (uint256 remaining) {
      return allowed[_owner][_spender];
    }

}

contract SimpleICO is StandardToken, SafeMath {
    uint constant initialSupply = 1000;

    uint presaleUntil = now + 1 hours;
    uint icoUntil = presaleUntil + 2 hours;


    uint constant presalePrice = 1 ether;
    uint constant icoPrice = 2 ether;

    modifier onlyCrowdsale {
        require(now < icoUntil);
        _;
    }

    modifier isCrowdsaleOver {
        require(now >= icoUntil);
        _;
    }

    function isPresale() internal view returns (bool){
        return (now < presaleUntil);
    }

    function isICO() internal view returns (bool) {
        return (now >= presaleUntil && now < icoUntil);
    }

    function buy() public onlyCrowdsale payable {
        uint price;
        if(isPresale()){
            price = presalePrice;
        } else {
            price = icoPrice;
        }

        uint tokens = msg.value / price;

        uint diff = msg.value % price;

        //allow him to withdraw later on
        approveFrom(msg.sender, this, tokens);

        if(diff > 0) {
            msg.sender.transfer(diff);
        }
    }


    function SimpleICO() public {
        transferLockedUntil = icoUntil;

        balances[this] = initialSupply;
    }
}
